INSERT INTO wz_oxdata VALUES ('4', '1', 'Red Potion increases the HP by 100.', 'Increases the HP by 50.', 'x');
INSERT INTO wz_oxdata VALUES ('4', '2', 'Lemon increases the MP by 150.', 'Increases the MP by 150.', 'o');
INSERT INTO wz_oxdata VALUES ('4', '3', 'The Warrior Potion increases the Weapon ATT by 10 for 3 min.', 'Increases the Weapon ATT by 5 for 3 min.', 'x');
INSERT INTO wz_oxdata VALUES ('4', '4', 'Blue Potion is 8 mesos cheaper at the Ellinia Department Store than other places.', 'The Blue Potion is cheaper in Ellinia Department Store.', 'o');
