INSERT INTO wz_oxdata VALUES ('4', '6', 'The Speed Potion will increase your speed for 5 min.', 'Increases the speed for 3 min.', 'x');
INSERT INTO wz_oxdata VALUES ('4', '7', 'The Wizard Potion will increase your Magic ATT by 10 for 5 min.', 'Increases the Magic ATT by 5 for 3 min.', 'x');
INSERT INTO wz_oxdata VALUES ('4', '8', 'The Sap of an Ancient Tree will increase your Magic ATT by 10 for 5 min.', 'Increases the Magic ATT by 10 for 5 min.', 'o');
INSERT INTO wz_oxdata VALUES ('4', '9', 'The Drake\'s Meat will increase your Weapon DEF by 10 for 3 min.', 'Increases the Weapon DEF by 10 for 3 min.', 'o');
INSERT INTO wz_oxdata VALUES ('4', '10', 'Drake\'s Blood will increase your Weapon ATT by 10 for 5 min.', 'Increases the Weapon ATT by 8 for 5 min.', 'x');
INSERT INTO wz_oxdata VALUES ('4', '11', 'Take one Power Elixir, and it\'ll restore your HP and MP back to 100%.', 'Power Elixir recovers all HP and MP.', 'o');
INSERT INTO wz_oxdata VALUES ('4', '12', 'Meat can be bought at stores for 106 mesos, and it recovers HP 100.', 'Increases the HP by 100.', 'o');
INSERT INTO wz_oxdata VALUES ('4', '100', 'Sniper Potion will increase your accuracy by 5 for 5 min.', 'Increases accuracy by 5 for 5 min.', 'o');
INSERT INTO wz_oxdata VALUES ('4', '101', 'Pizza costs 420 mesos, and one slice will recover HP 400.', 'Pizza costs 450 mesos.', 'x');
INSERT INTO wz_oxdata VALUES ('4', '102', 'Cake costs 320 mesos, and one piece will recover HP 100 and MP 100.', 'Check the 24 Hr Mobile Store', 'o');
INSERT INTO wz_oxdata VALUES ('4', '103', 'The Pure Water that can be purchased at 24 Hr Mobile Store costs 1600 mesos and recovers MP 800.', 'The Pure Water that can be purchased at 24 Hr Mobile Store costs 1650 mesos', 'x');
INSERT INTO wz_oxdata VALUES ('4', '104', 'Hot Dog costs 320 mesos and one will recover HP 300.', 'Check the 24 Hr Mobile Store', 'o');
INSERT INTO wz_oxdata VALUES ('4', '105', 'Hamburger costs 430 mesos and one will recover HP 400.', 'Hamburger costs 450 mesos.', 'x');
INSERT INTO wz_oxdata VALUES ('4', '106', 'You\'ll get 2,750 mesos from the stores if you sell your Power Elixir.', 'It fetches 2,500 mesos.', 'x');
INSERT INTO wz_oxdata VALUES ('4', '107', 'DEX Potion increases your avoidability by 5 for 3 min.', 'Increases the avoidability by 5 for 3 min.', 'o');
INSERT INTO wz_oxdata VALUES ('4', '108', 'Sunset Dew recovers MP 5000', 'It recovers MP 5,000.', 'o');
INSERT INTO wz_oxdata VALUES ('4', '109', 'Sunrise Dew recovers HP 4000.', 'It recovers MP 4,000.', 'x');
INSERT INTO wz_oxdata VALUES ('4', '110', 'Sunrise Dew can be sold to the stores for 4,050 mesos.', 'It\'s sold for 4,050 mesos.', 'o');
INSERT INTO wz_oxdata VALUES ('4', '111', 'Sunset Dew can be sold to the stores for 5,050 mesos.', 'It\'s sold for 5,100 mesos.', 'x');
INSERT INTO wz_oxdata VALUES ('4', '112', 'Pure Water can be bought through 24 Hr Mobile Store, Jane, Valen, Hana, or Mr. Sweatbottom.', 'Hana of El Nath does NOT sell pure water.', 'x');
INSERT INTO wz_oxdata VALUES ('5', '1', 'Once you complete the quest of \"Sera and Her Mirror\" at the Maple Island, you\'ll gain a little bit of EXP and mesos.', 'Only EXP, not mesos.', 'x');
INSERT INTO wz_oxdata VALUES ('5', '2', 'During the quest of \"Nina & Sen\'s Dinner\" at the Maple Island, Sen asks for the Mushroom Soup.', 'Sen wants the Mushroom Soup.', 'o');
INSERT INTO wz_oxdata VALUES ('5', '3', 'Once you complete the quest of \"Roger and the Apple\" at the Maple Island, you\'ll get a watermelon from him.', 'Gives away an apple.', 'x');
INSERT INTO wz_oxdata VALUES ('5', '4', 'Once you complete the quest of \"Deliver the Letter to the Chief\" at the Maple Island, you\'ll gain Wooden Shield.', 'Gives away a bandana.', 'x');
INSERT INTO wz_oxdata VALUES ('5', '5', 'Once you complete the quest of \"Biggs\' Collection of Items\" at the Maple Island, you\'ll gain a Wooden Sword.', 'You\'ll get either a Fruit Knife or a Razor.', 'x');
INSERT INTO wz_oxdata VALUES ('5', '6', 'The quest of \"Fixing Blackbull\'s House\" at Perion can only be cleared by the ones that have gone through the 1st job adv.', 'The quest can be completed even without a job adv.', 'x');
INSERT INTO wz_oxdata VALUES ('5', '7', 'To clear the quest of \"Pia and the Blue Mushroom\" at Henesys, you\'ll need 60 Horned Mushroom Caps and 60 Blue Mushroom Caps.', 'Not Horned Mushroom Caps, but Green Mushroom Caps.', 'x');
INSERT INTO wz_oxdata VALUES ('5', '8', 'Once you complete the quest of \"Jane and the Wild Boar\" at Lith Harbor, you\'ll gain a Scroll for Armor DEF.', 'Not the scroll for armor, but the scroll for weapon.', 'x');
INSERT INTO wz_oxdata VALUES ('5', '9', 'To clear the quest of \"Alex the Runaway Kid\" at Kerning City, you\'ll need to get a gold watch from Chief Stan and deliver it back to Alex.', 'Chief Stan is at Henesys, Alex at Kerning City.', 'o');
INSERT INTO wz_oxdata VALUES ('5', '10', 'The quest of \"Arwen and the Glass Shoes\" at Ellinia can only be completed once.', 'The \"Glass Shoes\" quest can be repeated over and over again.', 'x');
INSERT INTO wz_oxdata VALUES ('5', '11', 'To clear the quest of \"Fixing Blackbull\'s House,\" you\'ll need 50 tree branches and 30 firewoods.', 'You need 30 tree branches and 50 firewoods.', 'x');
INSERT INTO wz_oxdata VALUES ('5', '12', 'The time limit for Party Quest at Kerning City is 30 min.', 'Has to be cleared within the 30 min. time limit.', 'o');
INSERT INTO wz_oxdata VALUES ('5', '13', 'If you\'re over LV. 40, even without the 2nd job adv., you\'ll be able to take on the quest of \"Jane the Alchemist\"', 'You need to have 2nd job adv. in order to take on the quest.', 'x');
INSERT INTO wz_oxdata VALUES ('5', '14', 'You won\'t be able to enter the Party Quest at Kerning City if some other party is already in there.', 'Only one party can enter the map to take on the Party Quest at a time.', 'o');
INSERT INTO wz_oxdata VALUES ('5', '15', 'Alex the runaway kid from Kerning City\'s father is Mr. Wetbottom of the VIP sauna at Sleepywood.', 'Alex\'s father is Chief Stan of Henesys.', 'x');
INSERT INTO wz_oxdata VALUES ('5', '16', 'Once you clear the quest of \"John\'s Pink Flower Basket,\" you\'ll receive 30 screws from him as a reward.', 'You\'ll receive 30 screws from John.', 'o');
INSERT INTO wz_oxdata VALUES ('5', '17', 'Mr. Wetbottom\'s Secret Book is blue.', 'It\'s in red.', 'x');
INSERT INTO wz_oxdata VALUES ('5', '18', 'The ticket sold at the subway construction site for B1, B2, and B3 all cost 2,000 mesos.', 'B1 - 500 mesos. B2 - 1,200 mesos. B3 - 2,000 mesos.', 'x');
INSERT INTO wz_oxdata VALUES ('5', '19', 'The level limit for Party Quest at Kerning City is between 20 and 30.', 'The level limit is between 21 and 30.', 'x');
INSERT INTO wz_oxdata VALUES ('5', '20', 'To take on the quest of \"Building a New House for Blackbull,\" your fame level needs to be at least 5.', 'The fame level has to be at least 10.', 'x');
INSERT INTO wz_oxdata VALUES ('5', '21', 'Every time you clear Shumi\'s quest, your fame level will increase by 1, all 3 times.', 'You\'ll earn a total of +3 on fame level through her quests.', 'o');
INSERT INTO wz_oxdata VALUES ('5', '22', 'Once the quest of \"Sabirtrama and the Anti-Aging Medicine\" is cleared, you\'ll be able to gain either a Star Rock or a Moon Rock.', 'If the items are NOT of the ones Sabitrama requested, you\'ll get a Moon Rock instead.', 'o');
INSERT INTO wz_oxdata VALUES ('5', '23', 'For the quest of \"Sabitrama and the Diet Medicine,\" the color of the flowers he asks for are the same throughout.', 'The color of flowers differ everytime you ask him.', 'x');
INSERT INTO wz_oxdata VALUES ('5', '24', 'The Party Quest of Kerning City consists of 5 stages.', 'You need to clear 5 stages. There\'s also a bonus stage available.', 'o');
INSERT INTO wz_oxdata VALUES ('5', '25', 'The quest of \"Jane the Alchemist\" asks for materials 3 different times.', 'You need to gather up the materials 3 times to clear the quest.', 'o');
INSERT INTO wz_oxdata VALUES ('5', '26', 'For the quest of \"Sabitrama and the Diet Medicine,\" if you clear it without delivering the right herb, you\'ll just receive EXP 500.', 'You\'ll receive EXP 500 while clearing it.', 'o');
INSERT INTO wz_oxdata VALUES ('5', '100', 'Once you clear the quest of \"Jane and the Wild Boar,\" you\'ll receive a random weapon attack scroll of either 100%, 60%, or 10%.', 'You\'ll receive EXP 500 and a 60% Scroll for Weapon Att.', 'x');
INSERT INTO wz_oxdata VALUES ('5', '101', 'The Forest of Patience consists of 5 levels.', 'Diet Medicine (LV 1, 2). Anti-Aging Medicine (LV 3, 4, 5)', 'o');
INSERT INTO wz_oxdata VALUES ('5', '102', 'Shumi\'s quest goes from <Lost Coin - Lots of Money - Sack of Money> ', 'The 2nd quest is \"Shumi and the Lost Bundle of Money\"', 'x');
INSERT INTO wz_oxdata VALUES ('5', '103', 'The Unagi Special you\'ll need for Mr. Wetbottom\'s quests consists of Lupin Banana, Curse Eye Tail, and Pig Head.', 'Lupin Banana does NOT go in the Unagi Special.', 'x');
INSERT INTO wz_oxdata VALUES ('5', '104', 'The Deep Forest of Patience consists of 7 levels.', 'Deep Forest of Patience consists of 7 levels.', 'o');
INSERT INTO wz_oxdata VALUES ('5', '105', 'To clear the quest of \"Luke the Security Guy,\" you\'ll need 100 pieces of Jr. Necki Skin, 10 Stirge Wings, and 1 Pure Water. ', '1 Bowl of Salad, not Pure Water.', 'x');
INSERT INTO wz_oxdata VALUES ('5', '106', 'To clear the quest of \"Rowen and the Cursed Dolls,\" you\'ll need a total of 2,300 cursed dolls.', 'You\'ll need 100. 200, 400, 600, and 1,000 cursed dolls per quest.', 'o');
INSERT INTO wz_oxdata VALUES ('5', '107', 'To reawaken the Ragged Gladius from the quest of \"Manji\'s Ragged Gladius,\" you\'ll need the Moon Rock for it.', 'You need the Star Rock.', 'x');
INSERT INTO wz_oxdata VALUES ('5', '108', 'Once you clear the quest of \"Building a New House for Blackbull,\" you\'ll randomly receive a 10% Scroll for Weapon Att. ', 'The scrolls can be chosen according to your occupation.', 'x');
INSERT INTO wz_oxdata VALUES ('5', '109', 'The Deed to the Land you need to clear the quest of \"Building a New House for Blackbull\" can be obtained through Cold Eye.', 'The Deed can be obtained through Curse Eye.', 'x');
INSERT INTO wz_oxdata VALUES ('5', '110', 'Once you clear the quest of \"Ronnie & the Fairies Building a New House,\" you\'ll receive EXP 4,000.', 'You\'ll receive EXP 3,900.', 'x');
INSERT INTO wz_oxdata VALUES ('5', '111', 'Once you clear the quest of \"Sabitrama and the Anti-Aging  Medicine,\" your fame level will increase by 2.', 'Your fame level will increase, along with gaining some EXP and items.', 'o');
INSERT INTO wz_oxdata VALUES ('5', '112', 'Once you clear the quest of \"Pia\'s Present for a Friend,\" you\'ll receive an overall armor for Thief with the level limit of 60.', 'You\'ll receive a set of LV. 60 top and bottom.', 'x');
INSERT INTO wz_oxdata VALUES ('5', '113', 'The quest of \"Trade with Sergeant Charlie\" can be done regardless of the level.', 'The quest is available even to the beginners.', 'o');
INSERT INTO wz_oxdata VALUES ('5', '114', 'The NPC\'s that you need to see for the quest of \"Alpha Platoon\'s Network of Communication\" are Master Sergeant Fox, Staff Sergeant Bravo, Sergeant Charlie, and Corporal Easy.', 'They are Master Sergeant Fox, Staff Sergeant Bravo, Sergeant Charlie, and Corporal Easy.', 'x');
INSERT INTO wz_oxdata VALUES ('5', '115', 'For the quest of \"Looking For a Book of Ancient,\" all users over LV. 50, regardless of the job, can take part in it.', 'All users LV. 55 and over, minus the beginners, can take part in it.', 'x');
