INSERT INTO wz_oxdata VALUES ('6', '1', 'In order to become a Bowman, beginners need to head over to Bowman Training School.', 'The beginners can become bowmen at the Bowman Instructional School.', 'x');
INSERT INTO wz_oxdata VALUES ('6', '2', 'In order to become a Warrior, beginners need to head over to the Warrior Sanctuary.', 'The beginners can become Warriors at the Warrior Sanctuary.', 'o');
INSERT INTO wz_oxdata VALUES ('6', '3', 'In order to become a Magician, beginners need to head over to the Magic Library.', 'The beginners can become Magicians at the Magic Library.', 'o');
INSERT INTO wz_oxdata VALUES ('6', '4', 'The item you need to collect to make the 2nd job adv., all 30 of them, is called the Brown Crystal.', 'You need to collect 30 BLACK Crystals.', 'x');
INSERT INTO wz_oxdata VALUES ('6', '5', 'Once you have collected 30 Black Crystals for the 2nd job adv., you\'ll be awarded the \"Proof of a Hero.\"', 'Once you have collected 30 Black Crystals for the 2nd job adv., you\'ll be awarded the \"Proof of a Hero.\"', 'o');
INSERT INTO wz_oxdata VALUES ('6', '6', 'For the 2nd job adv., a Warrior can choose between becoming a Fighter, Page, or an Axeman.', 'You can choose between Fighter, Page, or Spearman as your 2nd job adv. as a Warrior. ', 'x');
INSERT INTO wz_oxdata VALUES ('6', '7', 'For the 2nd job adv., a Bowman can choose between becoming a Hunter or a Sniper.', 'Hunter for the Bowman, Sniper for the crossBowman.', 'o');
INSERT INTO wz_oxdata VALUES ('6', '8', 'For the 2nd job adv., a Thief can choose between becoming an Assassin or a Bandit.', 'Assassin for the Thief with throwing stars, Bandit for the Thief with daggers.', 'o');
INSERT INTO wz_oxdata VALUES ('6', '9', 'For the 2nd job adv., a Magician can choose between becoming a Wizard or a Priest.', 'You\'ll be choosing either Wizard or Cleric.', 'x');
INSERT INTO wz_oxdata VALUES ('6', '10', 'When the beginner is at level 10, he/she can choose to become a Warrior, Magician, Thief, or a Bowman.', 'You can become a Magician at LV. 8', 'x');
INSERT INTO wz_oxdata VALUES ('6', '11', 'For a beginner to become a Thief, one needs to have at least LUK of 25 or over.', 'You need DEX of 25 or over.', 'x');
INSERT INTO wz_oxdata VALUES ('6', '12', 'To make the 3rd job adv., the user needs be at least at LV. 70 or above.', 'The 3rd job adv. will be available to users at LV 70 or over.', 'o');
INSERT INTO wz_oxdata VALUES ('6', '13', 'When a beginner makes the first job adv., 1 skill point is awarded.', 'When a beginner makes the job adv., 1 skill point will be awarded.', 'o');
INSERT INTO wz_oxdata VALUES ('6', '14', '', 'Can\'t change your job into something totally different.', 'x');
INSERT INTO wz_oxdata VALUES ('6', '15', 'To make the 4th job advancement, you\'ll need to be at least at LV. 120, with a 3rd job adv. under your belt.', 'The 4th job adv. will be available to the ones over LV. 120.', 'o');
INSERT INTO wz_oxdata VALUES ('6', '16', 'A 1st-level Magician skill, \"Improving MP Recovery,\" goes up to level 15.', 'The skill goes up to level 16.', 'x');
INSERT INTO wz_oxdata VALUES ('6', '100', 'When the Spearman\'s skill, \"Hyper Body,\" is fully mastered, your MaxHP and MaxMP increases by 60%.', 'If you have mastered the skill, your MaxHP & MaxMP increases 60%.', 'o');
INSERT INTO wz_oxdata VALUES ('6', '101', 'When the Sniper\'s skill, \"Iron Arrow,\" is fully mastered, the damage will increase by 180%.', 'Once you have mastered the Iron Arrow, the damage will increase by 180%.', 'o');
INSERT INTO wz_oxdata VALUES ('6', '102', 'The Thief has a skill called \"Lucky Seven,\" which enables you to throw stars in mid-air.', 'Thieves can use skills while in mid-air.', 'o');
INSERT INTO wz_oxdata VALUES ('6', '103', 'All 2nd-level skills, regardless of the occupation, has a total of 6 sets of skills.', 'There are 8 different sets of skills for Warriors.', 'x');
INSERT INTO wz_oxdata VALUES ('6', '104', 'In order to become a Bowman, beginners need to head over to Bowman Training School.', 'The beginners can become thieves at the Thieves\' Hideout.', 'x');
INSERT INTO wz_oxdata VALUES ('6', '105', 'Magicians have 3 different types of jobs available for the 4th job adv.', 'Only Warriors have the jobs split 3 ways for the 4th job adv.', 'x');
